import React from 'react';
import axios from 'axios';

const baseUrl = "https://reqres.in/api/users?page=2";

class App extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            data: "hello",
        }
    }
    render(){
        return(
            <h1 onClick={this.recreateText}>{this.state.data}</h1>
        )
    }
    recreateText(){
        axios.get(baseUrl).then((res)=>{
            this.state.data = res.data.data[1].email;
        })
    }
}

export default App;
